<?php
class Solution {

    /**
     * 392. Is Subsequence
     * @param String $t
     * @return Boolean
     */
    function isSubsequence($s, $t) {
        if ($s === "") { return true; }
        /*
        $cleaned = preg_replace('/[^'.$s.']/', "", $t);
        //return strpos($cleaned, $s);
        print $cleaned;
        return (strpos($cleaned, $s) !== false) ? true : false ;
        */
        $matchString = "";
        $j = 0;
        for ($i = 0; $i < strlen($s); $i++) {
            while ($j < strlen($t)) {
                if ($s[$i] == $t[$j]) {
                    $matchString .= $t[$j];
                    $j++;
                    break;
                }
                $j++;
            }
        }
        return $matchString === $s;
    }
}

$c = new Solution;
